#include <dolfin/Form.h>

class pNonlinear2DBilinearForm : public dolfin::pForm
{
public:

  pNonlinear2DBilinearForm(dolfin::Function& w0) : dolfin::pForm()
  {
    __coefficients.push_back(&w0);
  }

  /// Return UFC form
  virtual const ufc::form& form() const
  {
    return __form;
  }
  
  /// Return array of coefficients
  virtual const dolfin::Array<dolfin::Function*>& coefficients() const
  {
    return __coefficients;
  }

private:

  // UFC form
  UFC_pNonlinear2DBilinearForm __form;

  /// Array of coefficients
  dolfin::Array<dolfin::Function*> __coefficients;

};

